import React from "react";
import "./Card.Module.css";
import Card from "../../Card.js";
import {SortBy} from "../../molecules";

export default function Grid(props) {
  const rows = [];
  for (let i = 0; i < props.products.length; i += 4) {
    const row = props.products.slice(i, i + 4);
    rows.push(row);
  }
  return (
    <div className="menu">
      <SortBy children="Buy Fresh Vegetables Online" sort={["Relevance","Popularity","Price"]}/>
      <div className="card">
        {rows.map((row, index) => (
          <div key={index} className="row flex">
            {row.map((item) => (
              <Card key={item.id} name={item} />
            ))}
          </div>
        ))}
      </div>
    </div>
  );
}
